import React, {Component} from "react"

class Grid extends Component{
    render(){

        var arr = new Array(50);

        for(var i=0;i<arr.length;i++){
            arr[i] = new Array(arr.length);
        }

        for(var i=0;i <arr.length;i++){
            for(var j=0;j<arr.length;j++){
                arr[i][j]=(<div>this </div>);
            }
        }

        return(
            <div>{arr}</div>
        );
    };
}

export default Grid;
